import React from 'react'
import styled from 'styled-components/native' 


export default function Seach() {
  return(
    <Container>
      <Feather
        name="chevron-left"
        size={32}
        color="#000"
      />
      <Title>Voltar</Title>
    </Container>
  )
}
  const Container = styled.SafeAreaView`
  
  ` 
  
  const Title = styled.Text`
    font-size: 22px;
  `
